class Solution(object):
    def maximumScore(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: int
        """
        from collections import defaultdict
        MOD = 10**9 + 7

        def prime_factors(x):
            factors = defaultdict(int)
            d = 2
            while d * d <= x:
                while (x % d) == 0:
                    factors[d] += 1
                    x //= d
                d += 1
            if x > 1:
               factors[x] += 1
            return len(factors)

        scores = [(prime_factors(num), num) for num in nums]
        scores.sort(reverse=True)

        result = 1
        for i in range(min(k, len(scores))):
            result = (result * scores[i][1]) % MOD
        return result
